import * as api from "@/api/system/task_configuration";
import Pagination from "@/components/Pagination";
export default {
  name: "Customer",
  components: {
    Pagination: Pagination
  },
  props: ['supplierCode', 'orgCode', 'materielselect', 'unMutiple'],
  data: function data() {
    return {
      list: null,
      total: 0,
      parentsRows: null,
      value3: "",
      selectedDetails: null,
      //已选中内容
      listQuery: {
        page: true,
        currentPage: 1,
        pageSize: 10,
        materielCode: undefined,
        supplierCode: undefined,
        orgCode: undefined,
        executionDateStart: undefined,
        executionDateEnd: undefined
      },
      temp: {
        materielCode: undefined,
        supplierCode: undefined,
        orgCode: undefined,
        materielName: undefined,
        state: 1,
        supplierName: undefined
      },
      selectCode: [],
      tableKey: 0
    };
  },
  created: function created() {
    this.getList();
  },
  filters: {
    resultFilter: function resultFilter(a) {
      if (a === 1) {
        return "等待被执行";
      } else if (a === 2) {
        return "暂停";
      } else if (a === 3) {
        return "删除";
      } else if (a === 4) {
        return "出现异常";
      } else if (a === 5) {
        return "开始执行";
      } else if (a === 6) {
        return "执行成功";
      }
    }
  },
  methods: {
    getList: function getList() {
      var _this = this;

      if (this.value3) {
        this.listQuery.executionDateStart = this.value3[0];
        this.listQuery.executionDateEnd = this.value3[1];
      } else {
        this.listQuery.executionDateStart = "";
        this.listQuery.executionDateEnd = "";
      }

      api.queryRecordsLog(this.listQuery).then(function (res) {
        _this.list = res.data.list;

        _this.list.forEach(function (item, index) {
          item.rowId = (_this.listQuery.currentPage - 1) * _this.listQuery.pageSize + index + 1;
        });

        _this.total = res.data.pages.count;
      });
    },
    handleQuery: function handleQuery() {
      this.listQuery.currentPage = 1;
      this.getList();
    },
    handleSizeChange: function handleSizeChange(val) {
      this.listQuery.pageSize = val;
      this.getList();
    },
    handleCurrentChange: function handleCurrentChange(val) {
      this.listQuery.currentPage = val;
      this.getList();
    }
  }
};
